import { api } from "../../utils";

const get = async () => {
  const array = [];
  const response = await api.get("/users.json");

  for (prop in response.data) {
    array.push(response.data[prop]);
  }

  return array;
};

const post = () => {
  return null;
};

export const usersApi = { get, post };
